import React, { useState, useEffect } from "react";
import Navbar from "./Navbar.js";

function App() {
  // API: https://reqres.in/api/users?page=1
  const [users, setUsers] = useState([]);
  const getUsers = async () => {
    const response = await fetch("https://reqres.in/api/users?page=1")
    const users = await response.json();
    setUsers(users.data);

  };
  useEffect(() => {
    getUsers();
  }, []);

  return (
    <div className="App">
      <Navbar />
      <div className="grid">
        <div className="users">
          <div>
            <img src="" />
          </div>
          <div className="details">
            <p className="id"><span>ID: </span>
              1
            </p>
            <div className="name">
              <p className="f_name"><span>First Name: </span>
                Gyan Prakash
              </p>
              <p className="l_name"><span>Last Name: </span>
                Kumar
              </p>
            </div>
            <p className="email">
              <span>E-mail: </span>
              gyanprakashk55@gmail.com
            </p>
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
